;; gorilla-repl.fileformat = 1

;; **
;;; # Pencil Sketch
;;; 
;;; [http://www.askaswiss.com/2016/01/how-to-create-pencil-sketch-opencv-python.html](http://www.askaswiss.com/2016/01/how-to-create-pencil-sketch-opencv-python.html)
;;; 
;;; Using OpenCV and Python, an RGB color image can be converted into a pencil sketch in four simple steps:
;;; 
;;; -     Convert the RGB color image to grayscale.
;;; -    Invert the grayscale image to get a negative.
;;; -     Apply a Gaussian blur to the negative from step 2.
;;; -     Blend the grayscale image from step 1 with the blurred negative from step 3 using a color dodge.
;; **

;; **
;;; ### Load the picture that will be sketched
;; **

;; @@
(ns opencv3.cartoon2
 (:require
  [opencv3.core :refer :all]
  [opencv3.utils :as u]))

(def img
  (-> "https://cdn.theculturetrip.com/wp-content/uploads/2016/01/canals2.jpg"
  u/mat-from-url
  (u/resize-by 0.10)))
(u/mat-view img)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"172\" height=\"172\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1543fe1d \"BufferedImage@1543fe1d: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 172 height = 172 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def gray (-> img clone (cvt-color! COLOR_BGR2GRAY)))
(u/mat-view gray)

(def inverted
  (-> gray clone (bitwise-not!)))
(u/mat-view inverted)

(def gaussed
  (-> inverted clone (gaussian-blur! (new-size 21 21) 0.0 0.0)))
(u/mat-view gaussed)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"172\" height=\"172\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2c40bd3f \"BufferedImage@2c40bd3f: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 172 height = 172 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(defn dodge-v2! [img_ mask]
  (let [ output (clone img_) ]
  (divide img_ (bitwise-not! (-> mask clone)) output 256.0)
  output))

(u/mat-view (dodge-v2! gray gaussed))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"172\" height=\"172\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6b939edf \"BufferedImage@6b939edf: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 172 height = 172 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(defn burn-v2! [ image mask]
  (bitwise-not! (dodge-v2! image mask)))
(u/mat-view (burn-v2! gray gaussed))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"172\" height=\"172\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3128f8be \"BufferedImage@3128f8be: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 172 height = 172 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; ## Apply a Canvas effect
;;; 
;;; Now that the main picture has been turned to a crayon styled art form, it would be nice to lay this out on a canvas looking mat.
;;; 
;;; This is done using the **multiply** function from OpenCV core.
;; **

;; @@
(def canvas (imread "resources/canvas.jpg" 0))
(resize! canvas (new-size (.cols gray) (.rows gray)))
(u/mat-view canvas)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"172\" height=\"172\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3b40973d \"BufferedImage@3b40973d: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 172 height = 172 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def output (new-mat))
(multiply (dodge-v2! gray gaussed) canvas output  (/ 1 256.0))
(u/mat-view output)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"172\" height=\"172\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x58b5c576 \"BufferedImage@58b5c576: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 172 height = 172 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; Let's make a function out of the above, so we can apply a few different canvas and see the output and effect of each of them.
;; **

;; @@
(defn apply-canvas! [ sketch canvas] 
  (let [ output (new-mat)]
    (resize! canvas (new-size (.cols sketch) (.rows sketch)))
    (multiply (-> sketch clone (cvt-color! COLOR_GRAY2RGB)) canvas output  (/ 1 256.0))
  	output  ))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;opencv3.cartoon2/apply-canvas!</span>","value":"#'opencv3.cartoon2/apply-canvas!"}
;; <=

;; @@
(def sketch (dodge-v2! gray gaussed))
(def canvas (imread "resources/canvas.jpg"))
(u/mat-view (apply-canvas! sketch canvas))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"172\" height=\"172\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7b00fb26 \"BufferedImage@7b00fb26: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 172 height = 172 #numDataElements 3 dataOff[0] = 2\"]"}
